import { Routes, Route } from 'react-router-dom';
import Home from './/pages/Home';
import MenuPage from './/pages/MenuPage';

function App() {
  return (
    
    <div className="App">
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/menu" element={<MenuPage />} />
      </Routes>
    </div>
  );
}

export default App;
